dir_pin: !PC13                      # 方向设置
enable_pin: !PE5                    # 使能引脚
rotation_distance: 40             # 主动轮周长mm （2GT-20T为 40mm  16T为 32mm）
gear_ratio: 80:16                   # 减速比
microsteps: 16                      # 细分

##	Make sure to update below for your relevant driver (2208 or 2209)
