max_temp: 110

[temperature_sensor ERCF]
sensor_type: temperature_mcu
sensor_mcu: mmu
min_temp: 0
max_temp: 60


[temperature_sensor Spider_Board]
sensor_type: temperature_mcu
sensor_mcu: mcu
min_temp: 0
max_temp: 60

[temperature_sensor Raspberry_Pi]
